import React, { useEffect, useState } from "react";
import Button from '@mui/material/Button';
const App=()=>{
 
const[num,setNum]=useState(0);

useEffect(()=>{
 document.title=`You clicked me ${num} times`;
});
return(
   <>
    <h1>Helloo EveryOne</h1>
    <Button onClick={()=>{
      setNum(num+1);
    }}>Click Me {num}
    </Button>
    </>
   

);
  
}
export default App;
